import React, { Component } from 'react';
import { Card } from 'react-bootstrap';
import bivakzones from '../bivakzones.json';




export default class WcList extends Component {
    constructor(props) {
        super(props);
        this.state = {
            properties: [],
            currentClass: null,
            classesAreLoading: true
        };
    }

    componentDidMount() {
        fetch('http://localhost:3001/w', { properties: { 'Content-Type': 'bivakzones/json' } })
            .then(r => r.json())
            .then(properties => {
                this.setState({ properties, dog: true });
            });
    }


    render() {
        return (
            <div>
                <Card>

                    <Card.Body>
                        <Card.Title></Card.Title>
                        <Card.Text>
                            <ul>

                                <li>openfire:{this.setstate.name}</li>

                            </ul>
                        </Card.Text>
                    </Card.Body>
                </Card>
            </div>
        )
    }
}
